import './Main.css';
import Navigation from './Navigation.mjs';

const Main = () => {
  return (
    <div className="main-page">
      <div className="main-header">
        <h1 className="logo">Learning-app</h1>
      </div>

      <Navigation />
    </div>
  );
};
export default Main;
